import React from 'react';
import {BrowserRouter as Router,Routes,Route,Link} from 'react-router-dom';
import Home from './Home.js';
import Product from './Product.js';
import People from './People.js';
import Join from './Join.js';
import logo from './logo.jpg';

function Header(){
	return(
	<>
	<Router>
	<div>
		<h4 className="title "><img src={logo}/> Exerevnisi </h4>
		<nav>
	<ul className="nav-links">
		<li>
		<Link  to="/" style={{ color:'black',textDecoration: 'none' }}>Home</Link>
		</li>
		<li>
		<Link exact to="localhost:3000/product" style={{color:'black', textDecoration: 'none' }}>Product</Link>
		</li>
		<li>
		<Link exact to="localhost:3000/people" style={{ color:'black',textDecoration: 'none' }}>People </Link>
		</li>
		<li>
		<Link to="/join us" style={{ color:'black',textDecoration: 'none' }}>Join Us</Link>
		</li>
	</ul>
	</nav>
	<hr/>
   <Routes>
		<Route  exact path="localhost:3000/product" component={Product}/>
		<Route  exact path="localhost:3000/people" component={People}/>
	</Routes>	
	</div>
	</Router>;


	</>
	);
}

export default Header;
